import React, { Component } from 'react';

class Products extends Component {
    constructor(props) {
        super(props);
        this.state = {
          product: null,
        };
      }
      render() { 
        return ( 
        <div>
            <ul>
            {this.props.products.map(product =>(
                <li key={product.id}>
                    <p>{product.title}</p>

                </li>
            ))}
            </ul>
        </div> );
    }
}
 
export default Products;
